`;

const WelcomeMsg = () => {
  return (
    <StyledDiv>
      <h3>안녕하세요!</h3>
      <h3>숙면 여행을 위한 가이드</h3>
      <h3>
        <span>몽글</span>입니다
      </h3>
    </StyledDiv>
  );
};

export default WelcomeMsg;
